fopen=open("estacoes.txt", "w")
estaca_gigante=estaca_gigante.split('\n')
nova_lista=[]
x=0
i=3
for elemento in estaca_gigante:
    elemento=elemento.strip(' ')
    if i==x:
        nova_lista.append(elemento)
        i+=5
    x+=1

for elemento in nova_lista:
    idex=elemento.find("Estação")
    fopen.write(elemento[idex:].partition('<')[0].partition(':')[2].strip(' ')+'\n')

fopen.close()
